#include "dataProcessor.h"

/* PNG */
static const wxString s_dataProcessor_64_png = wxT("");

wxIcon CValueMetaObjectDataProcessor::GetIcon() const
{
	return GetIconGroup();
}

wxIcon CValueMetaObjectDataProcessor::GetIconGroup()
{
	static wxIcon icon =
		CBackendPicture::GetIconFromBase64(s_dataProcessor_64_png, wxSize(16, 16));

	return icon;
}
